import React from "react";

export default function Result(props) {
  const [data, setData] = useState([{}]); //전체 데이터
  const url = `https://inspct.career.go.kr/inspct/api/psycho/report?seq=${props.location.state.url}`;

  async function fetchResult() {
    response = await axios.get(url);
    console.log(response);
  }
  useEffect(() => {
    fetchResult();
  }, []);

  useEffect(() => {
    if (data) {
      let resArr = [];
      data.map(() => {
        resArr.push("");
      });
      setResponse(resArr);
    }
  }, [data]);
  return <div>결과표페이지 만들자!</div>;
}
